import React from 'react';
import { Link } from 'react-router-dom/cjs/react-router-dom.min';
import SearchBar from './SearchBar';

const Header = () => {
  return (
    <div className="ui fixed menu">
      <div className="ui container center">
        <h1>FakeShop</h1>
        <div><h1>Mens</h1>{window.loc}</div>
        <h1>Womens</h1>
        <h1>Kids</h1>
      </div>

      <div className="search-bar">
        <SearchBar />
      </div>
      <div className="three-buttons">
        <Link to="/login">
        <img src="../../user-icon.png" style={{ height:30 ,width:30}}/>
        </Link>
      </div>
      <div className='three-buttons'>
      <Link to="/wishlist">
        {/* <button className="header-button" style={{}}>Go to Wishlist</button> */}
        <img src="../../wishbefore.png" style={{ height:30 ,width:30}}/>
      </Link>
      </div>
      <div className="three-buttons"> <img src="../../bag.png" style={{ height:30 ,width:30}}/></div>
    </div>
  );
};

export default Header;
